import * as types from './types';

const initialState = [];

function reducer(state=initialState, action: {
    type: string;
    payload: typeof initialState;
}): typeof initialState {
    switch(action.type) {
        case types.SET_MARTINGALES: 
            const newState = action.payload;
            return newState;

        default:
            return state;
    }
}

export default reducer;
